import { Box } from '@mui/material';
import React from 'react';

const Home = () => {
  return (
    <div className="root">
                <Box
                    display='flex'
                    justifyContent='center'
                    alignItems='center'
                    flexDirection='column'
                    maxWidth={640}
                    margin='auto'
                    padding={5}
                    borderRadius={5}
                    boxShadow={'5px 5px 10px #ccc'}
                    sx={{ backgroundColor: "#f5f5f5"}}>
                </Box>
    </div>
  );
}

export default Home;
